import React from 'react';
import './Cart.css';
import Header from './Header'; // Import Header component

function Cart({ navigateTo }) {
  return (
    <div>
      <Header navigateTo={navigateTo} /> {/* Include Header component */}
      <div className="cart-container">
        <div className="cart-header">
          <h2 className="cart-title">Your Cart</h2>
          <button className="cart-close-button">&times;</button>
        </div>
        <ul className="cart-items">
          {/* Example items; replace with dynamic data */}
          <li className="cart-item">
            <img src="/path-to-image.jpg" alt="Product" />
            <div className="cart-item-details">
              <span className="cart-item-title">Product Name</span>
              <span className="cart-item-quantity">Quantity: 1</span>
            </div>
            <span className="cart-item-price">$10.00</span>
          </li>
        </ul>
        <div className="cart-total">Total: $10.00</div>
        <button className="cart-checkout-button">Checkout</button>
      </div>
    </div>
  );
}

export default Cart;
